using System;
using System.Diagnostics.SymbolStore;
using System.Threading;

namespace AdventCalendar2018
{
    public static class Day5
    {
        private static void MainDay5()
        {
            var text = workText;
            var copy = text;
            
            while (Simplify(ref text))
            {
            }
            Console.WriteLine($"Result {text.Length}");

            var len = copy.Length;
            for (var car = 'A'; car <= 'Z'; car++)
            {
                var working = copy.Replace(car.ToString(), "");
                working = working.Replace(car.ToString().ToLower(), "");
                while (Simplify(ref working))
                {
                }

                if (working.Length < len)
                {
                    len = working.Length;
                }
            }
            Console.WriteLine($"Result 2:{len}");
        }

        private static bool Simplify(ref string text)
        {
            var lastCar = text[0];
            for (int i = 1; i < text.Length; i++)
            {
                var curCar = text[i];
                if (lastCar - curCar == 32 || lastCar - curCar == -32)
                {
                    text = text.Substring(0, i - 1) + text.Substring(i + 1);
                    return true;
                }

                lastCar = curCar;
            }

            return false;
        }

        private static string workText = "";

    }
}